import React from "react";
import { reduxForm, Field } from "redux-form";
import { Input, Form } from "antd";

let LoginForm = () => {
  // console.log("govno");
  const Values = values => {
    return <div>values : {values}</div>;
  };
  return (
    <>
      <Form>
        <div>
          <label> Name </label>
          <Field name="firstName" component="input" />
        </div>
      </Form>
      <hr />
      <Values />
    </>
  );
};

LoginForm = reduxForm({
  form: "login"
})(LoginForm);

export default LoginForm;
